import React from "react";
import { useParams } from "react-router-dom";

export default function HouseDetails(props) {
  const filteredHouse = props.houses.find((house) => house.Home_id === Number(props.houseId));

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>House Details</h2>
      {filteredHouse ? (
        <div>
          <p style={styles.detail}>Home ID: {filteredHouse.Home_id}</p>
          <p style={styles.detail}>City: {filteredHouse.Home_City}</p>
          <p style={styles.detail}>Governorate: {filteredHouse.Home_Governorate}</p>
          <p style={styles.detail}>Nature: {filteredHouse.Home_Nature}</p>
          <p style={styles.detail}>Type: {filteredHouse.Home_Type}</p>
        </div>
      ) : (
        <p style={styles.error}>No house found with the specified ID.</p>
      )}
    </div>
  );
}

const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    maxWidth: "400px",
    margin: "0 auto",
    padding: "20px",
  },
  title: {
    fontSize: "24px",
    fontWeight: "bold",
  },
  detail: {
    margin: "10px 0",
  },
  error: {
    color: "red",
    fontStyle: "italic",
  },
};
